about:
Experienced Commercial Banker, successful in sales, specialised on working capital management, asset and liability management, cross boarder finance solutions for midsize companies.
Leader and/or member of several managerial projects focusing on strategies to leverage the business, optimizing of internal processes as well as customizing existing operating models. Successful in leading and motivating people. P&L responsibility; International experience collected in the US and Asia.

Knowledge: working capital management, asset and liability management, cross boarder finance solutions, supply chain finance, sales & marketing, leadership skills, motivating people, p & l responsibility;

-Extensive experience of business advisor in the banking sector with strong competences in building a financial services clientele (banking and savings);
-Interpersonal skills, management, strategic planning, and high-integrity organization;
-Experience in acquisition of potential business clients with focus on financial statements and business activity providing respectable clients for the bank;
-Business intelligence, evaluating and preparing financial analysis for credit committee, presenting client and preparing draft proposal;
-Assisting clients in providing required information about products, advising clients on daily basis;
-Involved in number of activities relating business cycle management, conducting compliance reviews, and relevant training;
-Experience in mentoring and evaluating new employees preparing them to independently perform the work;
-Organizational, interpersonal, oral/written communication, project management, analytical and problem resolution skills with the ability to multi-task and resolve issues within tight deadlines.
